import React from 'react';
import './style.css';

export default class CardItem extends React.Component{
  render() {
    const divStyle={gridColumn: this.props.id}
    return (
        <div className="card" style={divStyle}>
          <img className="pic" src="/Pictures/1.png" alt="" />
          <div className="rectangle">
            <img className="logo" src="/Pictures/logo.png" alt="" />
          </div>
          <h2>Городское кафе "Якитория"</h2>
          <p className="food">Японская-Китайская</p>
          <div className="info">
            <span class="star"><i class="fa fa-star"></i></span>
            <p className="rating">4.7</p>
            <img className="clock" src="/Pictures/clock.png" alt="" />
            <p className="time">35-40 мин</p>
            <img className="car" src="/Pictures/car2.png" alt="" />
            <p className="cost">от 500₽</p>
          </div>
        </div>
    );
  }
}
